pragma solidity 0.4.24;

contract certify {
struct certificate {
address athourity_address;
string certificate_data;
}
struct user_certificate {
certificate[5] certificates;
uint count ;

}

mapping (address => user_certificate) public list;
function insert_certificate(address addr, string data) public {
uint count=list[addr].count;
list[addr].certificates[count].athourity_address=msg.sender;
list[addr].certificates[count].certificate_data=data;
list[addr].count++;
}
function whatever(string anything) public returns (string){
	return anything;
}
}
